</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\">pc-1500计算机数值计算程序集</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><br />
</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><img src=\"http://www.gsut.edu.cn/HdUpFile/20160623/20160623081659611.jpg\" border=\"0\" /><br />
</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\">1965年建校使用过的计算尺</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><br />
</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><img src=\"http://www.gsut.edu.cn/HdUpFile/20160623/20160623081706440.jpg\" border=\"0\" /><br />
</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\">刘翠兰教授</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><br />
</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;\"><p class=\"MsoNormal\" style=\"font-family:宋体;text-indent:24pt;\"><span style=\"font-size:12pt;line-height:32px;\">自学校校史博物馆发出了征集校史资料的倡议后，得到了全校师生员工和各单位的积极响应。特别是引起了离退休老教师、老前辈的广泛关注和支持。<span>6</span>月<span>21</span>日，土木学院离退休老教师刘翠兰教授将自己珍藏多年的珍贵教学试验用分析数据用日本原装<span>PC-1500</span>计算机赠予校史博物馆收藏。<span></span></span></p>
<p class=\"MsoNormal\" style=\"font-family:宋体;text-indent:24pt;\"><span style=\"font-size:12pt;line-height:32px;\">当天上午，<span>80</span>岁高龄的刘翠兰老师亲自来到校史博物馆办公室将自己珍藏多年的教学试验用计算机等实物捐赠给学校校史博物馆收藏。据了解，该计算机还带有数据分析打印机，在当时是非常先进的教学试验设备，这是刘翠兰老师课题组在<span>80</span>年代初购置的，用来对轻砼，试验分析数据所用。<span></span></span></p>
<p class=\"MsoNormal\" style=\"font-family:宋体;text-indent:24pt;\"><span style=\"font-size:12pt;line-height:32px;\">同时捐赠的实物还有<span>1965</span>年甘肃工业大学设计室在建校设计中使用过的计算尺、计算器等。这些珍贵的校史实物反映了学校老一辈教师发扬红柳精神、艰苦创业、辛勤耕耘在教学一线的历史见证，对于丰富学校校史实物、开展校史研究具有重要的价值。</span></p>
<p class=\"MsoNormal\" style=\"font-family:宋体;text-indent:24pt;\"><span style=\"font-size:12pt;\">捐赠过程中，刘翠兰老师还将自己和母校的故事向记者娓娓道来，深情回忆学校的发展历程，表达了老教师对学校的深厚感情。</span></p>
</div>','original','','','zhangdi','zhangdi','','2017-04-05 11:20:00','2017-04-05 11:20:58','normal','article','0','7281','0','0','','','','0','zh-cn'),('25','老教师杜桂荣向校史馆捐赠珍贵史料','','','','','<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><img border=\"0\" src=\"http://www.gsut.edu.cn/HdUpFile/20160615/20160615085636670.jpg\" /><br />
