</span></div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;\"><p class=\"MsoNormal\" style=\"font-family:宋体;\"><span style=\"font-size:12pt;line-height:32px;\">&nbsp;&nbsp;&nbsp; 自学校校史博物馆发出了征集校史资料的倡议后，得到了全校师生员工和各单位的积极响应。特别是引起了离退休老教师、老前辈的广泛关注和支持。6月11日，兰州理工大学机电学院离退休老教师杜桂荣决定将自己珍藏多年的珍贵教学史料赠予校史博物馆收藏。</span></p>
<p class=\"MsoNormal\" style=\"font-family:宋体;\"><span style=\"font-size:12pt;line-height:32px;\">&nbsp;&nbsp;&nbsp; 6月13日下午，在杜桂荣老师家中，杜老师将她个人和她丈夫（原化工学院院长刘振全教授已故）的教学资料等捐赠给学校校史博物馆。这对于丰富学校校史资料、开展校史研究都将具有重要的价值。党委宣传部段开军部长对杜桂荣老师为校史博物馆捐赠珍贵史料表示感谢，在她家中向杜桂荣老师颁发了《捐赠证书》。</span></p>
<p class=\"MsoNormal\" style=\"font-family:宋体;\"><span style=\"font-size:12pt;line-height:32px;\">&nbsp;&nbsp;&nbsp; 在这些珍贵的教学史料中，有杜桂荣老师个人和刘振全教授的毕业证书、盖有当年开展教学研究各类鉴定的红章文件、优秀共产党员荣誉证书，有矿机61班团支部在大庆与铁人王进喜合影的珍贵照片，还有刘振全教授当年在学校艰苦创业办学条件下教书育人的教案讲义，泛黄的手稿文笔清新，字里行间流露出刘教授对教学的严谨和细致，极具感染力，是反映学校老一辈教师发扬红柳精神、辛勤耕耘在教学一线生动鲜活、弥足珍贵的史料。</span></p>
<p class=\"MsoNormal\" style=\"font-family:宋体;\"><span style=\"font-size:12pt;\">&nbsp;&nbsp;&nbsp; “我这里还有一枚英国斯特拉斯克莱德大学校长给刘振全教授赠送纪念品，虽然搬了几次家，但一直用心珍藏，保存至今。”杜桂荣老师如是说。</span></p>
