<p style=\"font-family:宋体;color:#000000;font-size:12px;text-align:center;\"><span>捐赠证书</span></p>
<p style=\"font-family:宋体;color:#000000;font-size:12px;text-align:center;\"><span><img border=\"0\" src=\"http://www.gsut.edu.cn/HdUpFile/20160612/20160612111022534.jpg\" /></span></p>
<p style=\"font-family:宋体;color:#000000;font-size:12px;text-align:center;\"><span>捐赠期刊</span></p>
<p style=\"font-family:宋体;color:#000000;font-size:12px;text-align:justify;text-indent:32px;\"><span>&nbsp;&nbsp;</span><span><span style=\"font-size:12pt;\">6</span><span style=\"font-size:12pt;\">月12日，夏天东校长为校史馆捐赠自己珍藏多年的《甘肃工业大学学报（英文版）》创刊号及第2期杂志。两本杂志上有他当年撰写的英文论文</span><span style=\"font-size:12pt;\">《</span><span style=\"font-size:12pt;\">The Forms of Phases in the TiC-AI<b><sub>2</sub></b>O<b><sub>3</sub></b>&nbsp;Composites Combustion Synthesized from TiO<b><sub>2</sub></b>+AL+C</span><span style=\"font-size:12pt;\">》、《</span><span style=\"font-size:12pt;\">Combustion Front Quenching&nbsp;</span><span style=\"font-size:12pt;\">（</span><span style=\"font-size:12pt;\">CFQ</span><span style=\"font-size:12pt;\">）</span><span style=\"font-size:12pt;\">Investigation on the Self-Propagating High Temperature Synthesis of AI<b><sub>2</sub></b>O<b><sub>3</sub>-</b>TiC Composite</span><span style=\"font-size:12pt;\">》，</span><span style=\"font-size:12pt;\">有重要的史料价值。</span></span></p>','original','','','zhangdi','zhangdi','','2017-04-05 11:21:00','2017-04-05 11:22:08','normal','article','0','7258','0','0','','','','0','zh-cn'),('27','张培合校友向母校捐赠书画作品','','','','','<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><img border=\"0\" src=\"http://www.gsut.edu.cn/HdUpFile/20160603/20160603161519273.jpg\" /></p>
<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><span>个人文学作品</span></p>
<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><img border=\"0\" src=\"http://www.gsut.edu.cn/HdUpFile/20160603/20160603173105441.jpg\" /></p>
<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><span>个人书法作品</span></p>
<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><span></span>&nbsp;</p>
<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><img border=\"0\" src=\"http://www.gsut.edu.cn/HdUpFile/20160603/20160603172826374.jpg\" /></p>
<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><span>校史博物馆收藏证书</span></p>
<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><img border=\"0\" src=\"http://www.gsut.edu.cn/HdUpFile/20160603/20160603161656226.jpg\" /></p>
<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><span>收藏证书</span></p>
<p align=\"center\" style=\"font-family:宋体;color:#000000;font-size:12px;\">&nbsp;</p>
<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:宋体;color:#000000;text-indent:24pt;\"><span style=\"line-height:32px;font-size:12pt;\">5</span><span style=\"line-height:32px;font-size:12pt;\">月<span>28</span>日，在兰州理工大学陕西校友会第二届校友大会上，陕西校友会名誉会长张培合（甘肃工业大学机制<span>83</span>级）向母校图书馆、校史博物馆捐赠个人文化哲学系列作品集以及书画作品，表达对母校的深厚感情。学校曾华辉副校长代表学校接受捐赠。</span></p>
<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:宋体;color:#000000;text-indent:24pt;\">&nbsp;</p>
<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:宋体;color:#000000;text-indent:24pt;\"><span style=\"line-height:32px;font-size:12pt;\">张培合简介<span>,1964</span>年出生于甘肃省庆阳市宁县，于<span>20</span>世纪<span>80</span>年代毕业于甘肃工业大学，现任西北大学中国文化研究中心秘书长、西北大学丝绸之路研究院研究员、陕西省社会科学院研究员、独立文化学者、陕西省作家协会会员、陕西省企业文化建设协会会长、西安文史研究院高级研究员、西安科技大学兰州理工大学客座教授、《商道》杂志、《陕西设备管理》杂志总编辑，多年来致力于传播中国优秀传统文化。</span></p>
<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:宋体;color:#000000;text-indent:24pt;\"><span style=\"line-height:32px;font-size:12pt;\">张培合是中国当代较早开展国学培训讲座的文化学者之一。自<span>2003</span>年起，由其开坛主讲的《中国传统文化对企业管理者的影响》大型实战培训讲座，一经推出，便引起了企业管理层和社会各界的广泛好评，在业界有着深远的影响。著有《慧思集》、《静思集》、《微思集》、《广思集》、《思想的力量》等著作。</span></p>
<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:宋体;color:#000000;text-indent:24pt;\"><span style=\"line-height:32px;font-size:12pt;\">2014</span><span style=\"line-height:32px;font-size:12pt;\">年<span>5</span>月<span>20</span>日，张培合在陕西省企业文化建设协会理事长（会长）。</span></p>
<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:宋体;color:#000000;text-indent:24pt;\"><span style=\"line-height:32px;font-size:12pt;\">2014</span><span style=\"line-height:32px;font-size:12pt;\">年<span>5</span>月<span>31</span>日，张培合著作《微思集》荣获第六届冰心散文集奖。</span></p>
<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:宋体;color:#000000;text-indent:24pt;\"><span style=\"line-height:32px;font-size:12pt;\">2014</span><span style=\"line-height:32px;font-size:12pt;\">年<span>7</span>月<span>13</span>日，张培合作品研讨会在西安隆重举行，研讨会由著名作家贾平凹主持。</span></p>
<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:宋体;color:#000000;text-indent:24pt;\"><span style=\"line-height:32px;font-size:12pt;\">2014</span><span style=\"line-height:32px;font-size:12pt;\">年底，西安交通大学出版社编辑出版的张培合作品评论文集《思想的力量》正式对外发行。</span></p>
<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:宋体;color:#000000;text-indent:24pt;\"><span style=\"line-height:32px;font-size:12pt;\">2015</span><span style=\"line-height:32px;font-size:12pt;\">年，陕西日报发表其与巴隆峰合作的贾平凹长篇小说《老生》评论文章《随心所欲而不逾矩》，引起社会舆论的巨大的积极反响。<a name=\"ref_[11]_10755135\"></a><span>&nbsp;</span></span></p>','original','','','zhangdi','zhangdi','','2017-04-05 11:22:00','2017-04-05 11:22:45','normal','article','0','7280','0','0','','','','0','zh-cn'),('28','胡文瑞院士向图书馆捐赠图书','','','','','<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><span style=\"font-size:9pt;\">&nbsp;&nbsp;</span><a target=\"_blank\" href=\"http://www.gsut.edu.cn/HdUserUpFile/20150410212259495.jpg\"><img border=\"0\" src=\"http://www.gsut.edu.cn/HdUserUpFile/20150410212259495_s.jpg\" /></a></div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><span style=\"font-size:12pt;\">胡院士所捐图书</span></div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><br />
</div>
<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size:12pt;\">4月9日下午，中国科学院和我校共享院士、著名流体物理学家胡文瑞先生向图书馆捐赠图书。&nbsp;</span><div style=\"margin:0px;padding:0px;\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; &nbsp; 胡院士在指导我校科学研究工作之余，心系学校师生的学习和教育，为我校改革发展和图书馆资源建设无私奉献。在2004年来到兰州理工大学之初，他就向图书馆捐献了《不列颠大百科全书》一套二十本，这次已经是他第二次向图书馆捐献书籍了。此次捐献的书籍共22本，涉及物理、数学、生物等多个学科领域，其中有很多精品外文图书。</span></div>
<div style=\"margin:0px;padding:0px;\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; &nbsp; 据悉，胡院士在与部分教师交流的过程中，了解到许多在兰州查不到图书资料，他回到北京后，专程去有关图书馆查阅资料并复印，再带回兰州给有需要的师生参考学习。&nbsp;</span></div>
<div style=\"margin:0px;padding:0px;\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; &nbsp; 图书馆接受图书捐赠后，将迅速对其进行编目加工，以方便师生们查看借阅。同时也让胡院士的这份浓浓情谊传递给全校师生，转化为师生努力学习、奋发有为的新动力！</span></div>
</div>','original','','','zhangdi','zhangdi','','2017-04-05 11:23:00','2017-04-05 11:23:27','normal','article','0','7271','0','0','','','','0','zh-cn'),('11','关于我们','','about','','','&nbsp; &nbsp;','original','','','','','zhangdi','2014-10-08 14:38:00','2017-09-08 17:22:57','normal','page','0','1069','0','11','','','','0','zh-cn'),('22','爱思唯尔（Elsevier）出版集团向图书馆捐赠电子图书','','','','','<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0pt;font-family:宋体;color:#000000;font-size:12px;text-align:center;text-indent:28pt;\"><span style=\"font-size:14pt;font-family:仿宋;\"><a target=\"_blank\" href=\"http://www.gsut.edu.cn/HdUpFile/20160928/20160928171548840.jpg\"><img border=\"0\" src=\"http://www.gsut.edu.cn/HdUpFile/20160928/20160928171548840_s.jpg\" /></a></span></p>
<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0pt;font-family:宋体;color:#000000;font-size:12px;text-align:center;text-indent:28pt;\"><span style=\"font-size:12pt;font-family:仿宋;\">爱思唯尔（Elsevier）出版集团向图书馆捐赠电子图书</span></p>
<p class=\"MsoNormal\" align=\"justify\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><span><span style=\"font-size:12pt;font-family:仿宋;\">&nbsp;&nbsp;&nbsp; 在</span><span style=\"font-size:12pt;font-family:仿宋;\">9月27日下午举行的“ScienceDirect数据库专题培训暨学科建设分析评价报告”上，国际知名的科技出版商，荷兰爱思唯尔（Elsevier）出版集团向我校图书馆赠送其出版的我校陈剑虹教授、曹瑞教授的专著《Micromechanism of cleavage fracture of metals》（金属解理断裂微观机理），Elsevier中国区核心业务总经理应中锋先生代表本公司及出资方中国教育图书进出口公司向图书馆转交了电子图书网络使用权水晶铭牌，校图书馆李演军副馆长代表图书馆接受捐赠。</span><span style=\"font-size:12pt;font-family:仿宋;\"></span></span></p>
<p class=\"MsoNormal\" align=\"justify\" style=\"font-family:宋体;color:#000000;font-size:12px;\"><span><span style=\"font-size:12pt;font-family:仿宋;\">&nbsp;&nbsp;&nbsp;张全文馆长代表因在外讲学未能到场的两位作者及图书馆对捐赠方表示感谢，并介绍说，该书是我校学者与国际知名出版社合作出版的首部科技图书，该书综合了陈剑虹教授30多年在这一领域的研究成果，也是世界上首部专注于金属解理断裂微观机理研究的学术专著，近期，陈剑虹教授将赴美参加美国焊接学会学术年会，将就该书的理论成果做学术报告。原版书的翻译工作也在紧张进行，计划于明年出版中文版。应中锋先生表示，希望Elsevier能进一步与兰州理工大学学者合作，在促进学校科研论著出版、助力科技成果推广、加大学校国际化进程等方面做更多的努力。</span></span></p>','original','','','zhangdi','zhangdi','','2017-04-05 11:18:00','2017-04-05 11:19:35','normal','article','0','7067','0','0','','','','0','zh-cn'),('23','袁宗久校友向我校捐赠陶瓷泵一台','','','','','<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;text-align:center;\"><a href=\"http://www.gsut.edu.cn/HdUserUpFile/20161116084116241.jpg\" target=\"_blank\"><img src=\"http://www.gsut.edu.cn/HdUserUpFile/20161116084116241_s.jpg\" border=\"0\" /></a></div>
