<div style=\"margin:0px;padding:0px;color:#000000;font-family:微软雅黑;font-size:12px;\"><span style=\"font-size:12pt;\"></span><p class=\"MsoNormal\" style=\"font-family:宋体;\"><span style=\"font-size:14pt;\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 2016年</span></span><span style=\"font-size:12pt;\">11月10日</span><span style=\"font-size:12pt;\">上</span><span style=\"font-size:12pt;\">午，在</span><span style=\"font-size:12pt;\">第八届中国（</span><span style=\"font-size:12pt;\">上海</span><span style=\"font-size:12pt;\">）国际</span><span style=\"font-size:12pt;\">流体机械展览会上，兰州理工大学校友</span><span class=\"15\" style=\"font-size:12pt;\">袁宗久（</span><span class=\"15\" style=\"font-size:12pt;\">2005级</span><span class=\"15\" style=\"font-size:12pt;\">动力工程硕士研究生</span><span class=\"15\" style=\"font-size:12pt;\">）</span><span class=\"15\" style=\"font-size:12pt;\">为母校</span><span class=\"15\" style=\"font-size:12pt;\">捐赠</span><span class=\"15\" style=\"font-size:12pt;\">自己的专利产品</span><span class=\"15\" style=\"font-size:12pt;\">陶瓷泵一台。学校</span><span class=\"15\" style=\"font-size:12pt;\">校友总会刘全恩主任和能动学院冀宏院长接受</span><span class=\"15\" style=\"font-size:12pt;\">捐赠</span><span class=\"15\" style=\"font-size:12pt;\">。</span></p>
<p class=\"MsoNormal\" style=\"font-family:宋体;\"><span class=\"15\" style=\"line-height:2;font-size:12pt;\">&nbsp; &nbsp; 袁宗久</span><span style=\"line-height:2;font-size:12pt;\">感谢母校的培养。他说，作为兰州理工大学校友，在自己有能力的时候回馈母校，支持学校的发展，这是义不容辞的责任。他对母校近年来取得的办学成就感到自豪，并介绍了毕业后的工作历程和</span><span class=\"15\" style=\"line-height:2;font-size:12pt;\">沈阳第一水泵有限责任</span><span style=\"line-height:2;font-size:14pt;\"><span><span style=\"font-size:12pt;\">公司的发展情况，表示今后将继续为母校的建设和发展做力所能及的贡献。</span></span></span></p>
<p class=\"p\" style=\"font-family:宋体;\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 刘全恩</span><span style=\"font-size:12pt;\">对校友</span><span style=\"font-size:12pt;\">心系母校、回馈母校的捐赠行为表示感谢。他说，</span><span class=\"15\" style=\"font-size:12pt;\">袁宗久</span><span style=\"font-size:12pt;\">校友捐赠的</span><span class=\"15\" style=\"font-size:12pt;\">陶瓷泵</span><span style=\"font-size:12pt;\">设备不仅为</span><span style=\"font-size:12pt;\">母校</span><span style=\"font-size:12pt;\">相关专业发展改善了实验</span><span style=\"font-size:12pt;\">教学</span><span style=\"font-size:12pt;\">条件</span><span style=\"font-size:12pt;\">，也是</span><span style=\"color:#111111;font-size:14pt;\"><span><span style=\"font-size:12pt;\">对母校师弟、师妹的拳拳关爱</span></span></span><span style=\"color:#111111;font-size:14pt;\"><span><span style=\"font-size:12pt;\">，</span></span></span><span style=\"color:#111111;font-size:14pt;\"><span><span style=\"font-size:12pt;\">更是对母校教育工作的关心、支持和鼓舞</span></span></span><span style=\"font-size:12pt;\">。</span><span style=\"font-size:14pt;\"></span></p>
<p class=\"p\" style=\"font-family:宋体;\"><span style=\"font-size:12pt;\"><br />
</span></p>
<p class=\"p\" style=\"font-family:宋体;\"><b><span style=\"font-size:12pt;\">&nbsp; &nbsp; 个人简历：</span></b><span class=\"15\" style=\"font-size:12pt;\">袁宗久</span><span class=\"15\" style=\"font-size:12pt;\">，沈阳第一水泵有限责任公司，总经理，兰州理工大学</span><span class=\"15\" style=\"font-size:12pt;\">2005级</span><span class=\"15\" style=\"font-size:12pt;\">动力工程硕士研究生。</span></p>
<p class=\"p\" style=\"font-family:宋体;\"><b><span style=\"font-size:12pt;\">&nbsp; &nbsp; 公司简介：</span></b><span style=\"color:#333333;font-size:10.5pt;\"><span><span style=\"font-size:12pt;\">沈阳第一水泵有限责任公司始建于一九六二年，是我国泵类产品骨干生产企业之一，公司位于国家级高新技术开发区</span></span><span style=\"font-size:12pt;\">--沈阳经济技术开发区开发二十三号路17号，占地面积3.2万平方米，建筑面积1.7万平方米，</span></span><span style=\"font-size:10.5pt;\"><span><span style=\"font-size:12pt;\">；注册资金</span></span><span style=\"font-size:12pt;\">3000万元，</span></span><span style=\"color:#333333;font-size:10.5pt;\"><span><span style=\"font-size:12pt;\">三级计量检定单位。公司连续多年被沈阳市人民政府命名为</span></span><span style=\"font-size:12pt;\">“先进企业”称号，并取得ISO9001:2008质量管理体系认证、全国工业产品生产许可证、煤矿产品安全标志证、中石油、中石化入网证等行业准入资质，资信度为“AAA”企业。公司专业从事工业泵的研发制造，拥有一支精干的技术人员队伍，科技实力雄厚，设备精良，加工工艺先进，产品的开发能力较强。公司产品广泛服务于石油、化工、电站、矿山、冶金、造纸、制糖、食品、环保、军工、城市供水、农业排灌溉等行业及领域，部分产品远销拉美及亚洲等国家，为我国经济发展做出了突出贡献。</span></span></p>
</div>','original','','','zhangdi','zhangdi','','2017-04-05 11:19:00','2017-04-05 11:20:12','normal','article','0','7180','0','0','','','','0','zh-cn'),('14','兰州理工大学教育发展基金会简介','','brief-introduction','','','<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\"><span style=\"color:#000000;\">兰州理工大学的发展饱含着历代工大人的智慧和心血，也浸润着广大校友和社会贤达的爱心和力量。学校现有遍及海内外的近</span><span style=\"color:#000000;\">18</span><span style=\"color:#000000;\">万名校友，早在</span><span style=\"color:#000000;\">1998</span><span style=\"color:#000000;\">年就成立了校友会和董事会，汇聚了各地校友和一大批热心教育事业、关心高校发展的贤达人士。近年来，越来越多的海内外各界友人和校友纷纷慷慨捐赠，为学校的建设和发展提供支持。</span><span style=\"color:#000000;\">2013</span><span style=\"color:#000000;\">年</span><span style=\"color:#000000;\">6</span><span style=\"color:#000000;\">月，经过紧张地筹备和申请，成立了教育发展基金会和校友企业家俱乐部。俱乐部以“推动学校发展，促进校友间的合作共赢”为宗旨，是以校友企业家为主，以知名专家学者和社会各界知名人士为成员的非营利性社会组织，致力于为会员的发展创业打造一个志同道合、相互交流、资源共享的组织，同时为有潜力的新一代校友创业提供积极的帮助和支持。</span></p>
<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\"><span style=\"color:#000000;\">基金会属于非公募基金会，是我校多元化筹集办学资金的有效探索，有利于吸引社会各界参与学校发展建设，是学校与社会交流和校友回报母校的重要平台。理事会严格按照基金会章程，不断设立、完善资助和奖励项目，设立奖学金、奖教金及助学金，促进学校教学与研究设施改善、自主教学培训、技术研究及专注出版等各项工作，充分发挥基金会在推动学校发展中的重要作用。</span></p>
<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\"><span style=\"color:#000000;\">基金会在学校和基金会理事会的领导下，严格遵守有关法律法规，以服务学校事业发展为工作重点，旨在与海内外各界和校友加强合作交流，发展友好合作关系，积极争取更多的社会资源，促进兰州理工大学教育事业的发展。</span></p>
<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\"><span style=\"color:#000000;\">学校授权基金会为接受社会捐赠的专门管理机构，所有社会捐赠由基金会进行统一管理。基金会通过募集资金、接受捐赠，设立学生奖助学金、教师奖励基金、国际交流基金、学校发展基金等，为学校发展的各个领域提供有力的资金支持。</span></p>
<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\"><span style=\"color:#000000;\">基金会秉承</span><span style=\"color:#000000;\">“规范、透明、效益、安全、服务”的方针，认真负责各类捐赠款和基金会资金的管理，保证捐赠款的使用完全符合捐赠者意愿和基金会宗旨。</span></p>
<p class=\"MsoNormal\" style=\"text-indent:21.0000pt;\"><span style=\"color:#000000;\">2017年初本基金会获得中国社会组织评估5A等级并获得公益性捐赠税前扣除资格。面向未来，基金会将在广大校友和社会各界一如既往的支持和帮助下，秉承</span><span style=\"color:#000000;\">“奋进求是”的校训，注重自身建设和自我完善，锐意进取，奋发图强，为把兰州理工大学建设成为特色鲜明的高水平研究型大学而努力奋斗。</span></p>
