<h2 style=\"text-align:center;text-indent:2em;\">兰州理工大学教育发展基金会章程</h2>
<p align=\"center\" style=\"text-align:center;text-indent:2em;\"><br />
</p>
<p align=\"center\" style=\"text-align:center;text-indent:2em;\">（2013年6月）</p>
<p align=\"center\" style=\"text-align:center;text-indent:2em;\"><br />
</p>
<h3 style=\"text-align:center;text-indent:2em;\"><strong>第一章 总则</strong></h3>
<p style=\"text-align:justify;text-indent:2em;\">第一条&nbsp;本基金会的名称是：兰州理工大学教育发展基金会，英文译名为Lanzhou University of Technology Education Development Foundation,缩写为LUTEDF。</p>
<p style=\"text-indent:2em;\">第二条&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;本基金会属于非公募基金会。</p>
<p style=\"text-indent:2em;\">第三条&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;本基金会的宗旨：依照国家有关法律、法规，遵循社会主义核心价值体系，积极争取国内外团体和个人的捐助，推动兰州理工大学教育事业的发展和进步。</p>
<p style=\"text-indent:2em;\">第四条&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;本基金会的原始基金数额为人民币200万元（贰佰万元），来源于社会各界历年向兰州理工大学的捐款结余。</p>
<p style=\"text-indent:2em;\">第五条&nbsp;本基金会的登记管理机关是甘肃省民政厅，业务主管单位是甘肃省教育厅。</p>
<p style=\"text-indent:2em;\">第六条&nbsp;本基金会的办公地址：甘肃省兰州市七里河区兰工坪路287号，兰州理工大学三号楼203室。</p>
<h3 style=\"text-align:center;text-indent:2em;\"><strong>第二章 业务范围</strong></h3>
<p style=\"text-indent:2em;\">第七条&nbsp;本基金会的业务范围：</p>
<p style=\"text-indent:2em;\">（一）接受社会各界对兰州理工大学的捐赠，筹集教育发展基金；</p>
<p style=\"text-indent:2em;\">（二）设立与实施如下基金资助项目：</p>
<p style=\"text-indent:2em;\">1．支持教学与研究设施的改善（包括建筑物、仪器设备和图书资料等）；</p>
<p style=\"text-indent:2em;\">2．资助教学与培训项目、科学与技术研究项目及专著出版；</p>
<p style=\"text-indent:2em;\">3．支持人才引进，资助聘请国际知名学者来校讲学；</p>
<p style=\"text-indent:2em;\">4．资助召开高层次国际学术会议，或资助优秀教师及在校学生出国交流、参加国际学术会议；</p>
<p style=\"text-indent:2em;\">5．设立学生奖学金、助学金及教师奖励金；</p>
<p style=\"text-indent:2em;\">6．支持、投入与兰州理工大学教育事业有关的其他项目；</p>
<p style=\"text-indent:2em;\">7．按照捐赠者意愿设立的资助项目。</p>
<p style=\"text-indent:2em;\">（三）基金管理与运作，促使基金保值和增值；</p>
<p align=\"center\" style=\"text-align:center;text-indent:2em;\"><br />
</p>
<h3 style=\"text-align:center;text-indent:2em;\"><strong>第三章 组织机构、负责人</strong></h3>
<p style=\"text-indent:2em;\">第八条&nbsp;本基金会由11（或9）名理事组成理事会。理事每届任期为5年，任期届满，可连选连任。</p>
<p style=\"text-indent:2em;\">第九条&nbsp;理事的资格：</p>
<p style=\"text-indent:2em;\">（一）&nbsp;&nbsp;&nbsp;&nbsp;拥护本基金会的章程；</p>
<p style=\"text-indent:2em;\">（二）&nbsp;&nbsp;&nbsp;&nbsp;关心本基金会的发展，热心本基金会的工作；</p>
<p style=\"text-indent:2em;\">（三）&nbsp;&nbsp;&nbsp;&nbsp;对本基金会工作有实质性的支持，或在本基金会业务（行业、学科）领域内具有一定影响；</p>
<p style=\"text-indent:2em;\">（四）&nbsp;&nbsp;&nbsp;&nbsp;尽职尽责，廉洁自律；</p>
<p style=\"text-indent:2em;\">（五）&nbsp;&nbsp;&nbsp;&nbsp;具有完全民事行为能力。</p>
<p style=\"text-indent:2em;\">第十条&nbsp;理事的产生和罢免：</p>
<p style=\"text-indent:2em;\">（一）第一届理事由业务主管单位、主要捐赠人、兰州理工大学分别提名并共同协商确定。</p>
<p style=\"text-indent:2em;\">（二）理事会换届改选时，由业务主管单位、理事会、主要捐赠人共同提名候选人并组织换届领导小组，组织全部候选人共同选举产生新一届理事。</p>
<p style=\"text-indent:2em;\">（三）罢免、增补理事应当经理事会表决通过，报业务主管单位审查同意。</p>
<p style=\"text-indent:2em;\">（四）理事的选举和罢免结果报登记管理机关备案。</p>
<p style=\"text-indent:2em;\">（五）具有近亲属关系的不得同时在本基金会理事会任职。</p>
<p style=\"text-indent:2em;\">第十一条&nbsp;理事的权利和义务：</p>
<p style=\"text-indent:2em;\">（一）享有本基金会的选举权、被选举权和表决权；</p>
<p style=\"text-indent:2em;\">（二）享有对本基金会工作的监督权和指导权；</p>
<p style=\"text-indent:2em;\">（三）获得本基金会服务的优先权；</p>
<p style=\"text-indent:2em;\">（四）执行理事会决议；</p>
<p style=\"text-indent:2em;\">（五）履行职责，切实维护本基金会的合法权益；</p>
<p style=\"text-indent:2em;\">（六）积极为本基金会筹集资金。</p>
<p style=\"text-indent:2em;\">第十二条&nbsp;&nbsp;本基金会的决策机构是理事会。理事会行使下列职权：</p>
<p style=\"text-indent:2em;\">（一）制定、修改章程；</p>
<p style=\"text-indent:2em;\">（二）选举、罢免理事长、副理事长、秘书长；</p>
<p style=\"text-indent:2em;\">（三）决定重大业务活动计划，包括资金的募集、管理和使用计划；</p>
<p style=\"text-indent:2em;\">（四）年度收支预算及决算审定；</p>
<p style=\"text-indent:2em;\">（五）制定内部管理制度；</p>
<p style=\"text-indent:2em;\">（六）决定设立办事机构、分支机构、代表机构；</p>
<p style=\"text-indent:2em;\">（七）决定由秘书长提名的副秘书长和各机构主要负责人的聘任；</p>
<p style=\"text-indent:2em;\">（八）听取、审议秘书长的工作报告，检查秘书长的工作；</p>
<p style=\"text-indent:2em;\">（九）决定基金会的分立、合并或终止；</p>
<p style=\"text-indent:2em;\">（十）决定其他重大事项。</p>
<p style=\"text-indent:2em;\">第十三条&nbsp;理事会每年至少召开2次会议。理事会会议由理事长负责召集和主持。有&nbsp;1/3理事提议，必须召开理事会会议。如理事长不能召集，提议理事可推选召集人。召开理事会会议，理事长或召集人需提前5日通知全体理事、监事。</p>
<p style=\"text-indent:2em;\">第十四条&nbsp;理事会会议须有&nbsp;2/3以上理事出席方能召开；理事会决议须经出席理事过半数通过方为有效。</p>
<p style=\"text-indent:2em;\">下列重要事项的决议，须经出席理事表决，出席理事2/3以上通过方为有效：</p>
<p style=\"text-indent:2em;\">（一）章程的修改；</p>
<p style=\"text-indent:2em;\">（二）选举或者罢免理事长、副理事长、秘书长；</p>
<p style=\"text-indent:2em;\">（三）章程规定的重大投资；</p>
<p style=\"text-indent:2em;\">（四）基金会的分立、合并。</p>
<p style=\"text-indent:2em;\">第十五条&nbsp;理事会会议应当制作会议记录。形成决议的，应当当场制作会议纪要，并由出席理事审阅、签名。理事会决议违反法律、法规或章程规定，致使基金会遭受损失的，参与决议的理事应当承担责任。但经证明在表决时反对并记载于会议记录的，该理事可免除责任。</p>
<p style=\"text-indent:2em;\">第十六条&nbsp;本基金会设监事2名。监事任期与理事任期相同，期满可以连任。</p>
<p style=\"text-indent:2em;\">第十七条&nbsp;理事、理事的近亲属和基金会财会人员不得任监事。</p>
<p style=\"text-indent:2em;\">第十八条&nbsp;监事的产生和罢免：</p>
<p style=\"text-indent:2em;\">（一）监事由主要捐赠人、业务主管单位分别选派；</p>
<p style=\"text-indent:2em;\">（二）登记管理机关根据工作需要选派；</p>
<p style=\"text-indent:2em;\">（三）监事的变更依照其产生程序。</p>
<p style=\"text-indent:2em;\">第十九条&nbsp;监事的权利和义务：</p>
<p style=\"text-indent:2em;\">（一）监事依照章程规定的程序检查基金会财务和会计资料，监督理事会遵守法律和章程的情况。</p>
<p style=\"text-indent:2em;\">（二）监事列席理事会会议，有权向理事会提出质询和建议，并应当向登记管理机关、业务主管单位以及税务、会计主管部门反映情况。</p>
<p style=\"text-indent:2em;\">（三）监事应当遵守有关法律法规和基金会章程，忠实履行职责。</p>
<p style=\"text-indent:2em;\">第二十条&nbsp;在本基金会领取报酬的理事不得超过理事总人数的1/3。监事和未在基金会担任专职工作的理事不得从基金会获取报酬。</p>
<p style=\"text-indent:2em;\">第二十一条&nbsp;本基金会理事遇有个人利益与基金会利益关联时，不得参与相关事宜的决策；基金会理事、监事及其近亲属不得与基金会有任何交易行为。</p>
<p style=\"text-indent:2em;\">第二十二条&nbsp;理事会设理事长、副理事长和秘书长，从理事中选举产生。</p>
<p style=\"text-indent:2em;\">第二十三条&nbsp;本基金会理事长、副理事长、秘书长必须符合以下条件：</p>
<p style=\"text-indent:2em;\">（一）在本基金会业务领域内有较大影响；</p>
<p style=\"text-indent:2em;\">（二）理事长、副理事长、秘书长最高任职年龄不超过&nbsp;70周岁，秘书长为专职；</p>
<p style=\"text-indent:2em;\">（三）身体健康，能坚持正常工作；</p>
<p style=\"text-indent:2em;\">（四）具有完全民事行为能力。</p>
<p style=\"text-indent:2em;\">第二十四条&nbsp;有下列情形之一的人员，不能担任本基金会的理事长、副理事长、秘书长：</p>
<p style=\"text-indent:2em;\">（一）属于现职国家工作人员的；</p>
<p style=\"text-indent:2em;\">（二）因犯罪被判处管制、拘役或者有期徒刑，刑期执行完毕之日起未逾&nbsp;5年的；</p>
<p style=\"text-indent:2em;\">（三）因犯罪被判处剥夺政治权利正在执行期间或者曾经被判处剥夺政治权利的；</p>
<p style=\"text-indent:2em;\">（四）曾在因违法被撤销登记的基金会担任理事长、副理事长或者秘书长，且对该基金会的违法行为负有个人责任，自该基金会被撤销之日起未逾5年的。</p>
<p style=\"text-indent:2em;\">第二十五条&nbsp;本基金会的理事长、副理事长、秘书长每届任期5年，连任不超过两届。因特殊情况需超届连任的，须经理事会特殊程序表决通过，报业务主管单位审查并经登记管理机关批准同意后，方可任职。</p>
<p style=\"text-indent:2em;\">第二十六条&nbsp;本基金会理事长为基金会法定代表人。本基金会法定代表人不兼任其他组织的法定代表人。本基金会法定代表人应当由中国内地居民担任。本基金会法定代表人在任期间，基金会发生违反《基金会管理条例》和本章程的行为，法定代表人应当承担相关责任。因法定代表人失职，导致基金会发生违法行为或基金会财产损失的，法定代表人应当承担个人责任。</p>
<p style=\"text-indent:2em;\">第二十七条&nbsp;本基金会理事长行使下列职权：</p>
<p style=\"text-indent:2em;\">（一）召集和主持理事会会议；</p>
<p style=\"text-indent:2em;\">（二）检查理事会决议的落实情况；</p>
<p style=\"text-indent:2em;\">（三）代表基金会签署重要文件；</p>
<p style=\"text-indent:2em;\">（四）章程和理事会赋予的其他职权。</p>
<p style=\"text-indent:2em;\">第二十八条&nbsp;本基金会副理事长、秘书长在理事长领导下开展工作，秘书长行使下列职权：</p>
<p style=\"text-indent:2em;\">（一）主持开展日常工作，组织实施理事会决议；</p>
<p style=\"text-indent:2em;\">（二）组织实施基金会年度公益活动计划，拟定年度工作总结；</p>
<p style=\"text-indent:2em;\">（三）拟定资金的筹集、管理和使用计划；</p>
<p style=\"text-indent:2em;\">（四）拟定基金会的内部管理规章制度，报理事会审批；</p>
<p style=\"text-indent:2em;\">（五）协调各机构开展工作；</p>
<p style=\"text-indent:2em;\">（六）提议聘任或解聘副秘书长以及财务负责人，交由理事会决定；</p>
<p style=\"text-indent:2em;\">（七）提议聘任或解聘各机构主要负责人，由理事会决定；</p>
<p style=\"text-indent:2em;\">（八）决定各机构专职工作人员聘用；</p>
<p style=\"text-indent:2em;\">（九）章程和理事会赋予的其他职权。</p>
<p style=\"text-indent:2em;\"><br />
</p>
<h3 style=\"text-align:center;text-indent:2em;\"><strong>第四章&nbsp;</strong><strong>&nbsp;</strong><strong>财产的管理和使用</strong></h3>
<p style=\"text-indent:2em;\">第二十九条&nbsp;本基金会为非公募基金会，本基金会的收入来源于：</p>
<p style=\"text-indent:2em;\">（一）&nbsp;自然人、法人或其他组织的自愿捐赠；</p>
<p style=\"text-indent:2em;\">（二）&nbsp;政府资助；</p>
<p style=\"text-indent:2em;\">（三）&nbsp;核准的业务范围内开展活动或提供服务的收入；</p>
<p style=\"text-indent:2em;\">（四）&nbsp;投资收益；</p>
<p style=\"text-indent:2em;\">（五）&nbsp;其他合法收入。</p>
<p style=\"text-align:justify;text-indent:2em;\">第三十条&nbsp;本基金会接受捐赠，应当遵守法律法规，符合章程规定的宗旨和公益活动的业务范围。</p>
<p style=\"text-indent:2em;\">第三十一条&nbsp;本基金会的财产及其他收入受法律保护，任何单位、个人不得侵占、私分、挪用。</p>
<p style=\"text-indent:2em;\">第三十二条&nbsp;本基金会根据章程规定的宗旨和公益活动的业务范围使用财产；捐赠协议明确了具体使用方式的捐赠，根据捐赠协议的约定使用。接受捐赠的物资无法用于符合本基金会宗旨的用途时，基金会可以依法拍卖或者变卖，所得收入用于捐赠目的。</p>
<p style=\"text-indent:2em;\">第三十三条&nbsp;本基金会财产主要用于：</p>
<p style=\"text-indent:2em;\">（一）本章程规定的业务范围内的支出；</p>
<p style=\"text-indent:2em;\">（二）开展基金会日常工作及发展基金会事业所需经费；</p>
<p style=\"text-indent:2em;\">（三）其他符合基金会章程的款项。</p>
<p style=\"text-indent:2em;\">第三十四条&nbsp;本基金会的重大捐赠投资活动是指：</p>
<p style=\"text-indent:2em;\">（一）&nbsp;&nbsp;一次性接受金额在50万元（含）以上的捐赠活动。</p>
<p style=\"text-indent:2em;\">（二）&nbsp;&nbsp;一次性金额在50万元（含）以上的投资活动。</p>
<p style=\"text-indent:2em;\">（三）&nbsp;&nbsp;理事会认为对本基金会影响重大的其他投资、捐赠活动。</p>
<p style=\"text-indent:2em;\">第三十五条&nbsp;本基金会按照合法、安全、有效的原则实现基金的保值、增值。</p>
<p style=\"text-indent:2em;\">第三十六条&nbsp;本基金会每年用于从事章程规定的公益事业支出，不得低于上一年基金余额的8％。本基金会工作人员的工资福利和行政办公支出不超过当年总支出的10％。</p>
<p style=\"text-indent:2em;\">第三十七条&nbsp;本基金会开展公益资助项目，应当向社会公开所开展的公益资助项目种类以及申请、评审程序。</p>
<p style=\"text-indent:2em;\">第三十八条&nbsp;捐赠人有权向本基金会查询捐赠财产的使用、管理情况，并提出意见和建议。对于捐赠人的查询，基金会应当及时如实答复。本基金会违反捐赠协议使用捐赠财产的，捐赠人有权要求基金会遵守捐赠协议或者向人民法院申请撤销捐赠行为、解除捐赠协议。</p>
<p style=\"text-indent:2em;\">第三十九条&nbsp;本基金会可以与受助人签订协议，约定资助方式、资助数额以及资金用途和使用方式。本基金会有权对资助的使用情况进行监督。受助人未按协议约定使用资助或者有其他违反协议情形的，本基金会有权解除资助协议。</p>
<p style=\"text-indent:2em;\">第四十条&nbsp;本基金会应当执行国家统一的会计制度，依法进行会计核算、建立健全内部会计监督制度，保证会计资料合法、真实、准确、完整。本基金会接受税务、会计主管部门依法实施的税务监督和会计监督。</p>
<p style=\"text-indent:2em;\">第四十一条&nbsp;本基金会配备具有专业资格的会计人员。会计不得兼出纳。会计人员调动工作或离职时，必须与接管人员办清交接手续。</p>
<p style=\"text-indent:2em;\">第四十二条&nbsp;本基金会每年1月1日至12月31日为业务及会计年度，每年3月31日前，理事会对下列事项进行审定：</p>
<p style=\"text-indent:2em;\">（一）上年度业务报告及经费收支决算；</p>
<p style=\"text-indent:2em;\">（二）本年度业务计划及经费收支预算；</p>
<p style=\"text-indent:2em;\">（三）财产清册（当年度捐赠者名册及有关资料）。</p>
<p style=\"text-indent:2em;\">第四十三条&nbsp;本基金会进行年检、换届、更换法定代表人以及清算，应当进行财务审计。</p>
<p style=\"text-indent:2em;\">第四十四条&nbsp;本基金会按照《基金会管理条例》规定接受登记管理机关组织的年度检查。</p>
<p style=\"text-indent:2em;\">第四十五条&nbsp;本基金会通过登记管理机关的年度检查后，将年度工作报告在登记管理机关指定的媒体上公布，接受社会公众的查询、监督。</p>
<p align=\"center\" style=\"text-align:center;text-indent:2em;\"><br />
</p>
<h3 style=\"text-align:center;text-indent:2em;\"><strong>第五章&nbsp;</strong><strong>&nbsp;</strong><strong>终止和剩余财产处理</strong></h3>
<p style=\"text-indent:2em;\">第四十六条&nbsp;本基金会有以下情形之一，应当终止：</p>
<p style=\"text-indent:2em;\">（一）未完成章程规定的宗旨的；</p>
<p style=\"text-indent:2em;\">（二）无法按照章程规定的宗旨继续从事公益活动的；</p>
<p style=\"text-indent:2em;\">（三）基金会发生分立、合并的。</p>
<p style=\"text-indent:2em;\">第四十七条&nbsp;本基金会终止，应在理事会表决通过后15日内，报业务主管单位审查同意。经业务主管单位审查同意后15日内，向登记管理机关申请注销登记。</p>
<p style=\"text-indent:2em;\">第四十八条&nbsp;本基金会办理注销登记前，应当在登记管理机关、业务主管单位的指导下成立清算组织，完成清算工作。</p>
<p style=\"text-indent:2em;\">本基金会应当自清算结束之日起&nbsp;15日内向登记管理机关办理注销登记；在清算期间不开展清算以外的活动。</p>
<p style=\"text-indent:2em;\">第四十九条&nbsp;本基金会注销后的剩余财产，应当在业务主管单位和登记管理机关的监督下，通过以下方式用于公益目的：</p>
<p style=\"text-indent:2em;\">（一）将剩余财产转入兰州理工大学财务处，由兰州理工大学按照本基金会原章程精神，专款专用；</p>
<p style=\"text-indent:2em;\">（二）将剩余财产转入同类教育基金会。</p>
<p style=\"text-indent:2em;\">无法按照上述方式处理的，由登记管理机关组织捐赠给与本基金会性质、宗旨相同的社会公益组织，并向社会公告。</p>
<p align=\"center\" style=\"text-align:center;text-indent:2em;\"><br />
</p>
<h3 style=\"text-align:center;text-indent:2em;\"><strong>第六章&nbsp;</strong><strong>&nbsp;</strong><strong>章程修改</strong></h3>
<p style=\"text-indent:2em;\">第五十条&nbsp;本章程的修改，须经理事会表决通过后15日内，报业务主管单位审查同意。经业务主管单位审查同意后，报登记管理机关核准。</p>
<p style=\"text-indent:2em;\"><br />
</p>
<h3 style=\"text-align:center;text-indent:2em;\"><strong>第七章&nbsp;</strong><strong>&nbsp;</strong><strong>附则</strong></h3>
<p style=\"text-indent:2em;\">第五十一条&nbsp;本章程经2013年6月22日理事会表决通过。</p>
<p style=\"text-indent:2em;\">第五十二条&nbsp;本章程的解释权属于本基金会理事会。</p>
<p style=\"text-indent:2em;\">第五十三条&nbsp;本章程自登记管理机关核准之日起生效。</p>
<p style=\"text-indent:2em;\"><br />
</p>
