<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:22.5pt;\">2、学生医疗救助基金<span></span></p>
<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:22.5pt;\">3、优秀学生奖学基金<span></span></p>
<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:22.5pt;\">4、学生社会实践活动基金<span></span></p>
<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:22.5pt;\">5、学生科技创新实践基金<span></span></p>
<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:22.5pt;\">6、校企联合培养人才基金<span></span></p>
<p class=\"MsoNormal\" style=\"margin-left:10.5pt;text-indent:15.0pt;\">&nbsp;7、学生国际与境外留（访）学基金<span></span></p>
