</span></p>
<p><span style=\"color:#090101;font-family:\'Helvetica Neue\', Helvetica, \'Hiragino Sans GB\', \'Microsoft YaHei\', Arial, sans-serif;font-size:18px;\"><span style=\"color:#090101;font-family:\'Helvetica Neue\', Helvetica, \'Hiragino Sans GB\', \'Microsoft YaHei\', Arial, sans-serif;\">本次全省性社会组织评估工作经过社会组织自评、委托第三方评估机构初评、评估委员会审核终评，社会公示和公告等评估程序，完成对76家参评社会组织的规范化综合评估。共评出有评估等级的全省性社会组织52家，其中，5A级社会组织4家、4A级社会组织12家、3A级社会组织19家，2A级社会组织13家，1A级社会组织4家。</span></span></p>
<p style=\"text-align:center;\"><span style=\"color:#090101;font-family:\'Helvetica Neue\', Helvetica, \'Hiragino Sans GB\', \'Microsoft YaHei\', Arial, sans-serif;font-size:18px;\"><img src=\"{201711/f_7eff535fd78ecbb5def4aa347ec15052.jpg}\" alt=\"\" /><br />
