</span></p>
<p><span style=\"color:#090101;font-family:\'Helvetica Neue\', Helvetica, \'Hiragino Sans GB\', \'Microsoft YaHei\', Arial, sans-serif;font-size:18px;\"><span style=\"color:#3E3E3E;font-family:\'Helvetica Neue\', Helvetica, \'Hiragino Sans GB\', \'Microsoft YaHei\', Arial, sans-serif;\">冯晶晖在大会上作了题为《做好基金会 助力学校教育事业更大发展》的交流报告。兰州理工大学教育发展基金会于2013年6月8日正式成立，是我省省属高校成立的第一家教育发展基金会。四年来，基金会在学校党委的领导下，勇于创新，大胆探索，积极工作，初步探索出了一条欠发达地区地方高校借助社会力量推动教育事业发展的新路子。一是加强领导、完善机制，确保基金会依法依规运行。二是明确性质、履行宗旨，确保基金会健康有序运行。三是发动师生、群策群力，推动基金会不断发展壮大。四是勇于探索、积极创新，充分发挥基金会推动学校发展的作用。她表示，基金会将严格贯彻国家关于高校基金会管理的法律法规，全面贯彻落实《兰州理工大学教育发展基金会章程》，努力做到宣传工作常态化、捐赠工作重点化、收支工作规范化、自身建设制度化，不断提高基金会工作水平，为学校建设发展做出应有贡献。</span><br />
