</span>','original','','','zhangdi','zhangdi','','2017-10-01 13:25:00','2017-11-05 13:41:57','normal','article','0','25','0','0','','','','0','zh-cn'),('34','财政部，国家税务总局，民政部关于公益性捐赠税前扣除有关问题的补充通知','','','','','<span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\">各省、自治区、直辖市、计划单列市财政厅（局）、国家税务局、地方税务局、民政厅（局），新疆生产建设兵团财务局、民政局：</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 为进一步规范公益性捐赠税前扣除政策，加强税收征管，根据《财政部&nbsp;国家税务总局&nbsp;民政部关于公益性捐赠税前扣除有关问题的通知》（财税〔2008〕160号）的有关规定，现将公益性捐赠税前扣除有关问题补充通知如下：</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 一、企业或个人通过获得公益性捐赠税前扣除资格的公益性社会团体或县级以上人民政府及其组成部门和直属机构，用于公益事业的捐赠支出，可以按规定进行所得税税前扣除。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 县级以上人民政府及其组成部门和直属机构的公益性捐赠税前扣除资格不需要认定。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 二、在财税〔2008〕160号文件下发之前已经获得公益性捐赠税前扣除资格的公益性社会团体，必须按规定的条件和程序重新提出申请，通过认定后才能获得公益性捐赠税前扣除资格。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 符合财税〔2008〕160号文件第四条规定的基金会、慈善组织等公益性社会团体，应同时向财政、税务、民政部门提出申请，并分别报送财税〔2008〕160号文件第七条规定的材料。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 民政部门负责对公益性社会团体资格进行初步审查，财政、税务部门会同民政部门对公益性捐赠税前扣除资格联合进行审核确认。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 三、对获得公益性捐赠税前扣除资格的公益性社会团体，由财政部、国家税务总局和民政部以及省、自治区、直辖市、计划单列市财政、税务和民政部门每年分别联合公布名单。名单应当包括当年继续获得公益性捐赠税前扣除资格和新获得公益性捐赠税前扣除资格的公益性社会团体。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 企业或个人在名单所属年度内向名单内的公益性社会团体进行的公益性捐赠支出，可按规定进行税前扣除。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 四、2008年1月1日以后成立的基金会，在首次获得公益性捐赠税前扣除资格后，原始基金的捐赠人在基金会首次获得公益性捐赠税前扣除资格的当年进行所得税汇算清缴时，可按规定进行税前扣除。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 五、对于通过公益性社会团体发生的公益性捐赠支出，企业或个人应提供省级以上（含省级）财政部门印制并加盖接受捐赠单位印章的公益性捐赠票据，或加盖接受捐赠单位印章的《非税收入一般缴款书》收据联，方可按规定进行税前扣除。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 对于通过公益性社会团体发生的公益性捐赠支出，主管税务机关应对照财政、税务、民政部门联合公布的名单予以办理，即接受捐赠的公益性社会团体位于名单内的，企业或个人在名单所属年度向名单内的公益性社会团体进行的公益性捐赠支出可按规定进行税前扣除；接受捐赠的公益性社会团体不在名单内，或虽在名单内但企业或个人发生的公益性捐赠支出不属于名单所属年度的，不得扣除。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 六、对已经获得公益性捐赠税前扣除资格的公益性社会团体，其年度检查连续两年基本合格视同为财税〔2008〕160号文件第十条规定的年度检查不合格，应取消公益性捐赠税前扣除资格。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 七、获得公益性捐赠税前扣除资格的公益性社会团体，发现其不再符合财税〔2008〕160号文件第四条规定条件之一，或存在财税〔2008〕160号文件第十条规定情形之一的，应自发现之日起15日内向主管税务机关报告，主管税务机关可暂时明确其获得资格的次年内企业或个人向该公益性社会团体的公益性捐赠支出，不得税前扣除。同时，提请审核确认其公益性捐赠税前扣除资格的财政、税务、民政部门明确其获得资格的次年不具有公益性捐赠税前扣除资格。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 税务机关在日常管理过程中，发现公益性社会团体不再符合财税〔2008〕160号文件第四条规定条件之一，或存在财税〔2008〕160号文件第十条规定情形之一的，也按上述规定处理。</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 财政部　国家税务总局　民政部</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"><br />
</span><span style=\"line-height:27.8px;font-family:宋体;color:#000000;font-size:11.5pt;\"> 二○一○年七月二十一日</span>','original','','','zhangdi','zhangdi','','2017-04-05 11:47:00','2017-04-05 11:48:07','normal','article','0','7189','0','0','','','','0','zh-cn'),('1099','甘肃路桥建设集团有限公司捐款（土木学院）100000元（2017-9-30）','','','','','甘肃路桥建设集团有限公司捐款（土木学院）100000元，在此衷心感谢！','original','','','zhangdi','zhangdi','','2017-12-04 17:44:00','2017-12-04 17:45:24','normal','article','0','72','0','0','','','','0','zh-cn'),('1100','北京SMC教育基金会捐款（能动学院）150000元（2017-10-20）','','','','','北京SMC教育基金会捐款（能动学院）150000元<span style=\"font-size:12px;line-height:0px;\">，在此衷心感谢！</span>','original','','','zhangdi','zhangdi','','2017-12-04 17:45:00','2017-12-04 17:48:16','normal','article','0','74','0','0','','','','0','zh-cn'),('722','供热95魏新宇捐赠现金600元 （2009年校庆捐赠）','','','','','<span style=\"color:#FF0000;font-family:宋体;font-weight:bold;\">供热95魏新宇捐赠现金600元 ,在此表示衷心感谢！</span>','original','','','zhangdi','zhangdi','zhangdi','2017-10-02 09:55:00','2017-12-18 17:15:56','normal','article','0','23','0','0','','','','0','zh-cn'),('723','重庆水泵厂有限责任公司捐赠隔膜计量泵一台 （--）','','','','','<span style=\"color:#E53333;\">重庆水泵厂有限责任公司捐赠隔膜计量泵一台 （--）&nbsp;,在此表示衷心感谢！</span>','original','','','zhangdi','zhangdi','','2017-10-01 11:30:00','2017-11-05 15:47:30','normal','article','0','24','0','0','','','','0','zh-cn'),('724','供热95李志刚捐赠现金600元 （2009年校庆捐赠）','','','','','<span style=\"color:#FF0000;font-family:宋体;font-weight:bold;\">供热95李志刚捐赠现金600元 ,在此表示衷心感谢！</span>','original','','','zhangdi','zhangdi','zhangdi','2017-10-02 09:50:00','2017-12-18 17:16:26','normal','article','0','25','0','0','','','','0','zh-cn'),('725','中共酒泉市委酒泉市人民政府捐赠玉船一座 （--）','','','','','<span style=\"color:#E53333;\">中共酒泉市委酒泉市人民政府捐赠玉船一座 （--）&nbsp;,在此表示衷心感谢！</span>','original','','','zhangdi','zhangdi','','2017-10-01 11:30:00','2017-11-05 15:47:52','normal','article','0','25','0','0','','','','0','zh-cn'),('726','	吴 敏捐赠现金200元 （2013-6-21）','','','','','<span style=\"color:#E53333;\">