</tr>
<tr><td class=\"about_content\" style=\"font-family:宋体;text-align:left;\"><p align=\"left\" class=\"MsoNormal\"><span style=\"color:black;font-size:14pt;\">亲爱的海内外校友、</span></p>
<p align=\"left\" class=\"MsoNormal\"><span style=\"color:black;font-size:14pt;\">尊敬的社会各界友好人士：<span></span></span></p>
<p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"color:black;font-size:14pt;\">兰州理工大学是一所工科实力比较雄厚、理科水平不断提高、文科具有一定特色的多学科协调发展的理工科大学。长期以来，学校</span><span style=\"color:black;font-size:14pt;\">秉承<span>“</span>奋进求是<span>”</span>的校训，大力弘扬以<span>“</span>艰苦奋斗，自强不息，求真务实，开拓创新<span>”</span>为内涵的<span>“</span>红柳精神<span>”,</span></span><span style=\"color:black;font-size:14pt;\">经过</span><span style=\"color:black;font-size:14pt;\"><span>近百年</span></span><span style=\"color:black;font-size:14pt;\">的建设与发展，学校已成为甘肃工业强省、跨越转型的重要支撑。学</span><span style=\"color:black;font-size:14pt;\">校今天取得的成绩，凝聚着几代人的不懈努力和创业艰辛，更汇聚了广大校友和各界朋友的殷殷关切和鼎力支持。在此，谨向大家表示最诚挚的感谢和最崇高的敬意！<span></span></span></p>
<p class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"color:black;font-size:14pt;\">2013</span><span style=\"color:black;font-size:14pt;\">年<span>6</span>月，兰州理工大学教育发展基金会经甘肃省民政厅批准登记注册正式成立。基金会致力于加强学校与社会各界的联系和合作，争取国内外社会团体和个人的支持与捐赠，促进教育教学质量和学术水平的提高，推进内涵建设，力争为甘肃乃至全国社会经济发展和科技进步做出更大的贡献。基金会现向海内外校友、董事、社会各界友好人士发出捐款倡议，<span>大家的每一份</span></span><span style=\"color:black;font-size:14pt;\">热心捐赠，都将按照基金会章程<span>和相关财务管理制度</span>严格管理和使用，确保发挥最大效益<span>，全体师生将永远铭记每位捐赠者的支持。</span></span><span style=\"color:black;font-size:14pt;\"></span></p>
<p style=\"text-indent:30pt;\"><span><span style=\"color:black;font-size:14pt;\">祝事业兴旺发达，幸福安康！</span><span style=\"color:blue;font-size:14pt;\"></span></span></p>
<p align=\"left\" class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"font-family:仿宋;font-size:12pt;\"><span>&nbsp;</span></span></p>
<p align=\"left\" class=\"MsoNormal\" style=\"text-indent:30pt;\"><span style=\"font-family:仿宋;font-size:12pt;\"><span><span>接收单位：兰州理工大学教育发展基金会</span></span></span><span style=\"font-family:仿宋;font-size:12pt;\"><span><span><span></span></span></span></span></p>
<p align=\"left\" class=\"MsoNormal\" style=\"text-indent:30pt;\"><span><span><span style=\"font-family:仿宋;font-size:12pt;\">开户银行：</span><span style=\"font-family:仿宋;font-size:12pt;\">中国工商银行兰州兰工坪支行</span></span></span><span><span><span style=\"font-family:仿宋;font-size:12pt;\"></span></span></span></p>
<p align=\"left\" class=\"MsoNormal\" style=\"text-indent:30pt;\"><span><span><span style=\"font-family:仿宋;font-size:12pt;\">账<span>&nbsp;&nbsp;&nbsp;&nbsp;</span>号：</span><span style=\"font-family:仿宋;font-size:12pt;\">2703 3453 0900 0013 593</span></span></span><span><span><span style=\"font-family:仿宋;font-size:12pt;\"></span></span></span></p>
<p align=\"left\" class=\"MsoNormal\" style=\"text-indent:30pt;\"><span><span style=\"font-family:仿宋;font-size:12pt;\"><span>捐赠热线：<span>0931-2976377</span></span></span><span style=\"font-size:12pt;\">&nbsp;，0931-2976366&nbsp;</span><span style=\"font-family:仿宋;font-size:12pt;\"><span></span></span></span><span><span style=\"font-family:仿宋;font-size:12pt;\"><span></span></span></span></p>
<p align=\"left\" class=\"MsoNormal\" style=\"text-indent:30pt;\"><span><span style=\"font-family:仿宋;font-size:12pt;\"><span>捐赠地点：兰州理工大学三号楼202室</span></span><span style=\"font-size:12pt;\"></span></span><span><span style=\"font-size:14pt;\"></span></span></p>
<p align=\"left\" class=\"MsoNormal\"><span><span style=\"font-size:14pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:14pt;\">二〇一三年六月十八日</span></span></p>
