</tr>
<tr><td class=\"about_content\" style=\"font-family:宋体;text-align:left;\"><p>&nbsp;</p>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\"><img border=\"0\" height=\"332\" src=\"http://xyh.lut.cn/upfile/images/2013624164432.jpg\" width=\"500\" /></div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\">第一届理事会现场</div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\"><img border=\"0\" height=\"332\" src=\"http://xyh.lut.cn/upfile/images/2013624164443.jpg\" width=\"500\" /></div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\">李贵富书记代表学校与企业代表签订捐赠协议</div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\"><img border=\"0\" height=\"332\" src=\"http://xyh.lut.cn/upfile/images/2013624164454.jpg\" width=\"500\" /></div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;background-color:#E0F3FA;\">王晓明校长讲话</div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\"><img border=\"0\" height=\"332\" src=\"http://xyh.lut.cn/upfile/images/2013624164518.jpg\" width=\"500\" /></div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\">校友代表许仰曾发言</div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\"><img border=\"0\" height=\"332\" src=\"http://xyh.lut.cn/upfile/images/2013624164533.jpg\" width=\"500\" /></div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\">座谈会现场</div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;\"><p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 6</span><span style=\"font-size:12pt;\">月</span><span style=\"font-size:12pt;\">22</span><span style=\"font-size:12pt;\">日</span><span style=\"font-size:12pt;\">上午，兰州理工大学教育发展基金会、校友企业家俱乐部第一届理事会第一次会议在我校逸夫科技馆三号会议室召开。学校党委书记李贵富、校长王晓明等校领导，来自北京、上海等地的</span><span style=\"font-size:12pt;\">30</span><span style=\"font-size:12pt;\">多名校友代表，学校有关部门负责人参加会议。会议由党委书记李贵富主持。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 会上，王晓明校长对校友的到来表示欢迎并介绍了学校的发展概况。全体参会人员审议通过了《兰州理工大学教育发展基金会章程》和《兰州理工大学校友企业家俱乐部章程》，推选了教育发展基金会第一届理事会成员和校友企业家俱乐部第一届理事会成员。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 另悉，会议结束后，召开了校友企业家座谈会。</span><span style=\"font-size:12pt;\">30</span><span style=\"font-size:12pt;\">多名校友欢聚一堂，纷纷表达对母校的深厚情感和对学校发展的殷切期望。校友们各抒己见，为校友企业家俱乐部发展建言献策。上海豪高机电科技有限公司总经理、曾任学校流体动力工程系主任</span><span style=\"font-size:12pt;\">,</span><span style=\"font-size:12pt;\">液压气动研究所所长的许仰曾校友说，在学校工作了近</span><span style=\"font-size:12pt;\">30</span><span style=\"font-size:12pt;\">年，看到学校成立校友企业家俱乐部，十分高兴。希望通过这个平台，将校友企业家的动态、学校毕业生就业信息及时在校友间发布，实现资源共享，为校友个人和学校的发展提供更多的渠道和便利。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 座谈会后，学校李贵富书记和甘肃工大舞台技术工程有限公司等为学校教育发展基金作出捐赠的企业代表签订了捐赠协议。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 王晓明校长在座谈会上讲话。他说，学校的发展离不开广大校友的支持。希望通过校友企业家俱乐部这个平台，架起校友和母校之间相互交流的桥梁。他真诚希望广大校友通过校友企业家俱乐部这一平台，以多种形式支持学校办学，扩大学校社会影响力，提升学校办学水平。也期望广大校友借助校友企业家俱乐部这一平台，加强相互合作，互通信息，在各自事业发展上取得更大的成绩。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 会后，全体参会人员合影留念。（宣传部</span><span style=\"font-size:12pt;\">/</span><span style=\"font-size:12pt;\">供稿</span><span style=\"font-size:12pt;\">&nbsp;</span><span style=\"font-size:12pt;\">朱莉萍</span><span style=\"font-size:12pt;\">/</span><span style=\"font-size:12pt;\">网络编辑）</span></p>
</div>
</td>
</tr>
