<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;background-color:#E0F3FA;\">辛广楠局长宣读《关于成立兰州理工大学教育发展基金会的批复》</div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\"><img border=\"0\" height=\"332\" src=\"http://xyh.lut.cn/upfile/images/2013624163623.jpg\" width=\"500\" /></div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\">原副校长康龙教授宣读了教育发展基金会、校友企业家俱乐部第一届理事会成员名单</div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\"><img border=\"0\" height=\"333\" src=\"http://xyh.lut.cn/upfile/images/2013624163635.jpg\" width=\"500\" /></div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\">校友付大志代表校友讲话</div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\"><img border=\"0\" height=\"332\" src=\"http://xyh.lut.cn/upfile/images/2013624163647.jpg\" width=\"500\" /></div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;text-align:center;\">大会现场</div>
<div style=\"padding:0px;margin:0px;color:#000000;font-family:微软雅黑;\"><p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 6</span><span style=\"font-size:12pt;\">月</span><span style=\"font-size:12pt;\">22</span><span style=\"font-size:12pt;\">日</span><span style=\"font-size:12pt;\">下午，兰州理工大学教育发展基金会暨校友企业家俱乐部成立大会在逸夫科技馆报告厅隆重举行。校友企业家俱乐部顾问、我校原任党委书记，现任省高校工委书记王智平，校友企业家俱乐部顾问、我校原任校长、现任兰州市市长袁占亭，省民政厅民间组织管理局局长辛广楠，我校党委书记李贵富，校长王晓明等校领导，全体中干、师生代表和来自北京、上海、哈尔滨、四川、湖北、甘肃等地的</span><span style=\"font-size:12pt;\">30</span><span style=\"font-size:12pt;\">余名工大校友代表参加大会。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 会上，原副校长</span><span style=\"font-size:12pt;\">康龙</span><span style=\"font-size:12pt;\">教授宣读了教育发展基金会、校友企业家俱乐部第一届理事会成员名单。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 北京世纪和有科技有限公司董事长、我校</span><span style=\"font-size:12pt;\">85</span><span style=\"font-size:12pt;\">级机制专业校友付大志代表校友讲话。他说，希望通过母校校友企业家俱乐部这个平台，整合校友资源，有效解决学校发展难题；同时向社会各界展示杰出校友的创业事迹和他们情系母校，关爱学子的赤诚。今后，俱乐部将不定期地开展大型公益活动，更好的提升学校与会员单位的知名度与美誉度，向社会传递正能量。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 辛广楠局长宣读了《关于成立兰州理工大学教育发展基金会的批复》。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 在热烈的掌声中，袁占亭市长和李贵富书记共同为“兰州理工大学教育发展基金会”揭牌。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 甘肃工大舞台技术工程有限公司、兰州理工大学技术工程学院、天水星火机床有限公司等</span><span style=\"font-size:12pt;\">11</span><span style=\"font-size:12pt;\">家校友企业家代表向学校教育发展基金会捐赠</span><span style=\"font-size:12pt;\">400</span><span style=\"font-size:12pt;\">余万元。基金会共收到班级及个人捐赠</span><span style=\"font-size:12pt;\">50</span><span style=\"font-size:12pt;\">余万元。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 省高校工委书记王智平在会上讲话，代表省高校工委、省教育厅对兰州理工大学教育发展基金会的成立表示热烈的祝贺。他说，兰州理工大学教育发展基金会和校友企业家俱乐部的正式成立，创新了校友支持母校发展、强化校友之间合作的形式，对于进一步加强学校与校友所在企业的合作，实现企业与学校共赢有重要意义。他指出，学校今后的发展，一要服务好校友企业家俱乐部，吸引更多的校友支持和参与我省经济社会发展；二要强化办学特色，通过提高自身综合办学实力，为我省高等教育事业发展做贡献；三要结合我省经济社会发展实际和产业特点，加强科技研发和成果转化，为我省主导产业和新兴产业发展提供有力的科技、人才和智力支撑。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 兰州理工大学教育发展基金会第一届理事会理事长、校党委书记李贵富讲话。他说，我校现有遍及海内外的近</span><span style=\"font-size:12pt;\">14</span><span style=\"font-size:12pt;\">万名校友，早在</span><span style=\"font-size:12pt;\">1998</span><span style=\"font-size:12pt;\">年就成立了校友会和董事会，汇聚了各地校友和一大批热心教育事业、关心高校发展的贤达人士，为学校发展提供了有力的支撑。今天，学校积极借鉴兄弟院校的好经验、好做法，顺应广大校友的期盼和学校发展的需要，成立了教育发展基金会和校友企业家俱乐部。俱乐部以“推动学校发展，促进校友间的合作共赢”为宗旨，是以校友企业家为主，以知名专家学者和社会各界知名人士为成员的非营利性社会组织，致力于为会员的发展创业打造一个志同道合、相互交流、资源共享的组织，同时为有潜力的新一代校友创业提供积极的帮助和支持。</span></p>
<p class=\"MsoNormal\"><span style=\"font-size:12pt;\">&nbsp; &nbsp; 李贵富书记说，我校创立教育发展基金会属甘肃省属高校首例。基金会属于非公募基金会，是我校多元化筹集办学资金的有效探索，有利于吸引社会各界参与学校发展建设，是学校与社会交流和校友回报母校的重要平台。今后，理事会将严格按照基金会章程，不断设立、完善资助和奖励项目，设立奖学金、奖教金及助学金，促进学校教学与研究设施改善、自主教学培训、技术研究及专注出版等各项工作，充分发挥基金会在推动学校发展中的重要作用。李贵富书记表示，学校将不负重托，继续深化内涵建设，强化办学特色，不断提升办学水平，更好地为广大校友服务、为经济社会发展服务。(宣传部/供稿 朱莉萍/网络编辑)</span></p>
</div>
</td>
</tr>
</tbody>
