<p style=\"text-align:center;\">会场&nbsp;</p>
<p class=\"p15\" style=\"text-indent:24pt;\"><span style=\"color:#000000;font-size:12pt;\">2014年12月12日，中国高等教育学会教育基金工作研究分会第十六次年会在四川电子科技大学国际会议中心举行。来自全国1</span><span style=\"color:#000000;font-size:12pt;\">70</span><span style=\"color:#000000;font-size:12pt;\">余所高校的3</span><span style=\"color:#000000;font-size:12pt;\">0</span><span style=\"color:#000000;font-size:12pt;\">0</span><span style=\"color:#000000;font-size:12pt;\">余</span><span style=\"color:#000000;font-size:12pt;\">名代表参加了此次会议。</span><span style=\"color:#000000;font-size:12pt;\">我校派校友总会程山老师参加了此次大会。</span><span style=\"color:#000000;font-size:12pt;\"></span></p>
<p class=\"p15\" style=\"text-indent:24pt;\"><span style=\"color:#000000;font-size:12pt;\">会议由中国高等教育学会常务理事、清华大学教育基金会理事黄建华主持。本次会议为期一天，上午会议分为开幕式和大会主题论坛。开幕式上，电子科技大学党委副书记、教育发展基金会副理事长王亚非、中国高等教育学会康凯秘书长分别致辞并讲话。在大会主题论坛上，北京大学教育基金会副秘书长胡俊、西北工业大学基金会秘书长</span><span style=\"color:#000000;font-size:12pt;\">张英群、基金会中心网总裁程刚、中航信托北京财富中心机构部总经理刘巍分别作了《从凝聚共识到协调行动——高校筹资的几点思考和实践》、《不忘初心&nbsp;方得始终——“爱心直通车”》、《大学基金会—中国高校发展助力器“2014中国大学基金会的挑战”》、《公益信托及其在高校基金会中的应用》的主题发言。</span><span style=\"color:#000000;font-size:12pt;\"></span></p>
<p class=\"p15\"><span style=\"color:#000000;font-size:12pt;\">&nbsp; &nbsp; 下午会议分为会员代表大会和分组讨论。在会员代表大会上，中国高等教育学会办公室主任沙玉梅宣读批复文件，同意教育基金工作研究分会换届申请及组成人员名单。黄建华理事长通报了换届选举情况，并作工作报告。在随后进行的分组讨论中，各高校基金会围绕如何调动校内外资源开展筹款工作、筹款的策略和方法、捐赠者的联系与管理、捐赠项目的管理、基金会的信息化管理、财务管理与资金运作等议题进行了分组讨论。</span><span style=\"color:#000000;font-size:12pt;\"></span></p>
<p class=\"p15\"><span style=\"color:#000000;font-size:12pt;\">&nbsp; &nbsp; 我校基金会于2013年正式成立，今年首次参加教育基金工作年会，并申请加入为会员单位。会议期间，</span><span style=\"color:#000000;font-size:12pt;\">程山老师非</span><span style=\"color:#000000;font-size:12pt;\">常珍惜学习和交流机会，认真听取了主题报告、积极参与专题讨论。本次参会促进了我校基金会与国内兄弟院校、教育基金同行的了解与联系，对我校基金会的发展起到了积极的作用。</span><span style=\"color:#000000;font-size:12pt;\"></span></p>
<p class=\"p15\"><span style=\"color:#000000;font-size:12pt;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 校友总会</span><span style=\"color:#000000;font-size:12pt;\"></span></p>
<p class=\"p15\"><span style=\"color:#000000;font-size:12pt;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2014年12月12日</span></p>
